"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: When men develop breasts (gynecomastia) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/when-men-develop-breasts-gynecomastia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H28924395\">",
"      <span class=\"h1\">",
"       What is gynecomastia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Gynecomastia is the medical term for when boys or men develop breasts. The condition can be embarrassing and sometimes even painful. Luckily, it often goes away on its own. If it doesn't go away, or if the condition is very uncomfortable, there are treatments that can help.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28924402\">",
"      <span class=\"h1\">",
"       What are the symptoms of male breast development?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Boys and men who develop breasts can have growth in both breasts or just 1. Sometimes the area behind the nipple is tender (hurts when it is touched).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28924409\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See a doctor or nurse if your breast or breasts:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Are growing very fast",
"       </li>",
"       <li>",
"        Have grown a lot (more than 2 to 3 inches of tissue under the nipple)",
"       </li>",
"       <li>",
"        Are very painful",
"       </li>",
"       <li>",
"        Worry or embarrass you a lot",
"       </li>",
"       <li>",
"        Have grown and you also have a lump on one of your testes, or you think you might have another illness",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should also see a doctor if you are an adult man and you have a lump in your breast that is off to the side instead of under the nipple. This could be a sign of breast cancer. It is very rare, but men can sometimes get breast cancer.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28924416\">",
"      <span class=\"h1\">",
"       Is there a test for male breast development?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes and no. If you are male and have what look like breasts, your doctor or nurse will feel them to check if what you have is really breast tissue or if it is fat, which is not the same thing. Doctors and nurses can usually tell the difference just by feeling the breasts (",
"      <a class=\"graphic graphic_figure graphicRef65845 \" href=\"mobipreview.htm?19/45/20178\">",
"       figure 1",
"      </a>",
"      ). But sometimes they need to order a special kind of x-ray of the breast called a mammogram. Doctors and nurses sometimes also order blood tests to check hormone levels in boys and men who develop breasts.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28924423\">",
"      <span class=\"h1\">",
"       How is male breast development treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are a number of treatments. But treatment is often not needed. The one that's right for you will depend on the cause of your condition, how long it has lasted, how severe it is, and how much it hurts or bothers you.",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        In teenage boys, breast development is usually caused by normal hormone changes that happen at that age. In these cases, breasts usually go away on their own without treatment. Still, doctors sometimes give a medicine called",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?5/28/5574?source=see_link\">",
"         tamoxifen",
"        </a>",
"        to boys with very large or painful breasts.",
"       </li>",
"       <li>",
"        In adult men, breast development is usually caused a health problem or by a drug the man takes. In these cases, treating the health problem or stopping the drug usually makes the breasts go away. But if the doctor can&rsquo;t figure out the cause of breast development, he or she might prescribe",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?5/28/5574?source=see_link\">",
"         tamoxifen",
"        </a>",
"        .",
"       </li>",
"       <li>",
"        In adult men who have had breasts for more than a year,",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?5/28/5574?source=see_link\">",
"         tamoxifen",
"        </a>",
"        does not usually help. These men can instead have surgery to reduce the size of their breasts.",
"       </li>",
"       <li>",
"        Men with prostate cancer whose cancer is treated with certain types of hormone therapy sometimes develop breasts. They can take",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?5/28/5574?source=see_link\">",
"         tamoxifen",
"        </a>",
"        or have radiation treatment before getting the hormone therapy to reduce the chances that this will happen.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28924506\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?35/45/36562?source=see_link\">",
