" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 484px\">",
"   <div class=\"ttl\">",
"    High-resolution esophageal pressure topography and conventional manometry in a patient with nutcracker esophagus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 464px; height: 604px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High-resolution esophageal pressure topography (panel A) and conventional manometry (panel B) from a patient with nutcracker esophagus. High-resolution esophageal pressure topography reveals vigorous contractions (indicated by the dark red color) with normal relaxation of the hypertensive lower esophageal sphincter and normal propagation velocity. Vigorous contractions are also demonstrated on the conventional manometric tracing that reveals high pressure amplitudes (tracing to the right of the arrow). Normal bolus transit by impedance is seen at the top of both panels.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
