var title_f43_30_44523="CHD risk equivalents";
var content_f43_30_44523=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F71255&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F71255&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Coronary heart disease (CHD) risk equivalents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Diabetes mellitus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; It is preferable to calculate patient-specific risks rather than to simply consider all patients with DM to have a CHD risk equivalent. A downloadable calculator for this purpose is available for patients with type 2 DM from the",
"        <a href=\"file://www.dtu.ox.ac.uk/riskengine/\" target=\"_blank\">",
"         UK Prospective Diabetes Study",
"        </a>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; If a patient-specific risk calculator cannot be accessed, we suggest considering the following patients with DM to have a CHD risk equivalent:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        - Men over age 40 with type 2 DM and any other CHD risk factor, or over age 50 with or without other CHD risk factors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        - Women over age 45 with type 2 DM and any other CHD risk factor, or over age 55 with or without other CHD risk factors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        - Men or women of any age who have had DM (type 1 or type 2) for more than 20 years if they have another risk factor or more than 25 years without another risk factor.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Symptomatic carotid artery disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Peripheral arterial disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Abdominal aortic aneurysm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Multiple risk factors that confer a 10-year risk of CHD &gt;20 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Chronic kidney disease with creatinine &gt;1.5 mg/dL [133 &micro;mol/L] or estimated GFR &lt;60 mL/min per 1.73 m",
"         <sup>",
"          2",
"         </sup>",
"         *",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Statin doses may require adjustment in patients with CKD.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
