var title_f43_30_44524="ACC AHA angiography dx CAD";
var content_f43_30_44524=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F80133&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F80133&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for coronary angiography to establish a diagnosis in patients with suspected angina, including those with known CAD who have a significant change in anginal symptoms",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Class I",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patients with known or possible angina pectoris who have survived sudden cardiac death.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Class IIa",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Patients with an uncertain diagnosis after noninvasive testing in whom the benefit of a more certain diagnosis outweighs the risk and cost of coronary angiography.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Patients who cannot undergo noninvasive testing due to disability, illness or morbid obesity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3. Patients with an occupational requirement for a definitive diagnosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4. Patients who by virtue of young age at onset of symptoms, noninvasive imaging or other clinical parameters are suspected of having a nonatherosclerotic cause for myocardial ischemia (coronary artery anomaly, Kawasaki disease, primary coronary artery dissection, radiation-induced vasculoplasty).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5. Patients in whom coronary artery spasm is suspected and provocative testing may be necessary.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        6. Patients with a high pretest probability of left main or three-vessel CAD.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Class IIb",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Patients with recurrent hospitalization for chest pain in whom a definite diagnosis is judged necessary.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Patients with an overriding desire for a definitive diagnosis and a greater-than-low probability of CAD.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Class III",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Patients with significant comorbidity in whom the risk of coronary arteriography outweighs the benefit of the procedure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Patients with an overriding personal desire for a definitive diagnosis and a low probability of CAD.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        ACC/AHA classification",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Class I:",
"        </strong>",
"        Conditions for which there is evidence and/or general agreement that a given procedure or treatment is useful and effective.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        <strong>",
"         Class II:",
"        </strong>",
"        Conditions for which there is conflicting evidence and/or a divergence of opinion about the usefulness/efficacy of a procedure or treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <strong>",
"         Class IIa:",
"        </strong>",
"        Weight of evidence/opinion is in favor of usefulness/efficacy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <strong>",
"         Class IIb:",
"        </strong>",
"        Usefulness/efficacy less well established by evidence/opinion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Class III:",
"        </strong>",
"        Conditions for which there is evidence and/or general agreement that the procedure/treatment is not useful and in some cases may be harmful.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Gibbons, RJ, Abrams, J, Chatterjee, K, et al. ACC/AHA 2002 guideline update for the management of patients with chronic stable angina. Available at: www.acc.org/qualityandscience/clinical/statements.htm (accessed August 24, 2006).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
